function shape54(ctx,ctrans,frame,ratio,time){
	drawPath(ctx,"M -1580 2180 L -1580 -2040 1740 -2040 1740 2180 -1580 2180 ");
	ctx.save();
	ctx.clip();
	ctx.transform(20,0,0,20,-1580,-2040);
	ctx.transform(1.0060240963855422,0,0,1.004739336492891,-0.5,-0.5);
	var fimg = ctrans.applyToImage(imageObj53);
	var pat=ctx.createPattern(fimg,"repeat");
	ctx.fillStyle = pat;
	ctx.fillRect(-16384,-16384,32768,32768);
	ctx.restore();
}

function sprite55(ctx,ctrans,frame,ratio,time){
	ctx.save();
	ctx.transform(1,0,0,1,79.0,102.0);
	var clips = [];
	var frame_cnt = 1;
	frame = frame % frame_cnt;
	switch(frame){
		case 0:
			place("shape54",canvas,ctx,[0.05,0.0,0.0,0.05,0.0,0.0],ctrans,1,0,0,time);
			break;
	}
	ctx.restore();
}

var frame = -1;
var time = 0;
var frames = [];
frames.push(0);

var backgroundColor = "#ffffff";
var originalWidth = 166;
var originalHeight= 211;
function nextFrame(ctx,ctrans){
	var oldframe = frame;
	frame = (frame+1)%frames.length;
	if(frame==oldframe){time++;}else{time=0;};
	drawFrame();
}

function drawFrame(){
	ctx.fillStyle = backgroundColor;
	ctx.fillRect(0,0,canvas.width,canvas.height);
	ctx.save();
	ctx.transform(canvas.width/originalWidth,0,0,canvas.height/originalHeight,0,0);
	sprite55(ctx,ctrans,frames[frame],0,time);
	ctx.restore();
}

window.setInterval(function(){nextFrame(ctx,ctrans);},40);
;</script>
